  return (
    <div className='faq inline-flex flex items-center'>
      <h1 className='circle-no mx-4 grid place-items-center prim-color text-sm'>{props.no}</h1>
      <div className='flex justify-between'>
        <h2>{props.ques}</h2>

      </div>
      <Plus/>
      {/* <p>{props.ans}</p> */}
    </div>
  )
}

export default Question;
